import{FrameworkHelpModel}from"../../model/help/framework-help-model.js";import{Utility}from"../../shared/utility.js";import ScriptSeriesLoader from"../../shared/script-series-loader.js";import StylesheetSeriesLoader from"../../shared/stylesheet-series-loader.js";class FrameworkHelpController{constructor(){this.model=new FrameworkHelpModel,this.stylesheetLoader=StylesheetSeriesLoader,this.stylesheetLoader.add("css/work-experience.min.css"),this.stylesheetLoader.load(),this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"),this.scriptLoader.load()}static build=async()=>{const e=new FrameworkHelpController;for(;e.scriptLoader.running;)await Utility.sleep(2e3);return e};execute=()=>{const e=this.model.getFrameworks();for(let r=0;r<e.length;r++){const t=e[r],s=[];s.push(this.createNoTd(r)),s.push(this.createNameTd(t)),s.push(this.createDescriptionTd(t));const o=`<tr>${s.join("")}</tr>`;$("#help-info tr:last").after(o)}};createTd=e=>`<td class='help-info-cell'>${e}</td>`;createNoTd=e=>{const r=e+1;return this.createTd(`<p style='text-align:center;'>${r}</p>`)};createNameTd=e=>this.createTd(`<p class="work-experience-technology-framework" style="white-space:nowrap;">${e.name}</p>`);createDescriptionTd=e=>this.createTd(`<p>${e.description}</p>`)}export{FrameworkHelpController};